import { showRenewHistory } from '../actions/actions'

class GetRequest {
  static async getHistory() {
    return function(dispatch) {
      fetch('/his')
        .then((response) => response.json())
        .then((data) => dispatch(showRenewHistory(data)))
    }
  }
}

export default GetRequest
